import styled from "styled-components";
import React from 'react';

export default function Skills({language}) {

  return (
    <Container >
        {!language ? <>
                <h1>Habilidades</h1>
                <h2>Técnicas</h2>
                <h3>Desenvolvimento Fullstack com as seguintes ferramentas</h3>
                <h3>- CSS</h3>
                <h3>- HTML</h3>
                <h3>- Javascript</h3>
                <h3>- Typescript</h3>
                <h3>- React</h3>
                <h3>Banco de dados com as seguintes ferramentas</h3>
                <h3>- MongoDB</h3>
                <h3>- PostgreSQL</h3>
                <h3>- Prisma</h3>
                <h3>Técnicas de Engenharia para compreensão e solução de problemas</h3>
                <h2>Sociais</h2>
                <h3>Comunicação</h3>
                <h3>Coordenação</h3>
                <h3></h3>
                <h2>Administrativas</h2>
                <h3>Criação de eventos de pequeno e médio porte</h3>
                <h3>1.5 Anos de experiência como Diretor acadêmico do Centro Acadêmico de Engenharia Elétrica e da Computação da Escola Politécnica da USP</h3>
            </> :
            <>
                <h1>Skills</h1>
            </>}
    </Container>
  );
}


const Container = styled.div`
    height: 85vh;
    padding-left: 5%;
    padding-right: 5%;
    display: flex;
    flex-direction: column;
    background-color: #080808;


    h1{
        padding-top: 10vh;
        font-size: 40px;
        font-weight: 700;
        font-family: 'Times New Roman', Times, serif;
        color: white;
    }

    div {
        display: flex;
    }

    h2 {
        padding-top: 5vh;
        font-size: 20px;
        font-weight: 400;
        font-family: 'Times New Roman', Times, serif;
        color: white;
    }
    h2 {
        padding-top: 5vh;
        font-size: 16px;
        font-weight: 400;
        font-family: 'Times New Roman', Times, serif;
        color: white;
    }
`
